import React from 'react';
import ProcessFlow from './pages/ProcessFlow';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Home } from './pages/Home';
import { Header } from './ui/components/AllPages/Header';

const App: React.FC = () => {
  return (
    <>
      <Header />
      <main>
        <BrowserRouter>
          <Routes>
            <Route path="/"  element={<Home />}/>
            <Route path='/mapeamentos' element={<ProcessFlow />}/>
          </Routes>
        </BrowserRouter>
      </main>
    </>
  );
};

export default App;
